import React from 'react';
import logo from '../../assets/sugardbare-logo.png';

const Footer = () => {
  return (
    <div style={{ backgroundColor: '#CCB6A0' }}>
      <div
        className="mx-auto grid place-items-center text-white px-6 md:px-12"
        style={{ maxWidth: '1550px' }}>
        <img src={logo} className="w-48" />
        <p>
          Follow us on social media for beauty
          <br />
          tips, updates, and promotions
        </p>
      </div>
    </div>
  );
};

export default Footer;
